css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("multcloud.com")
{

  input, textarea
  {
    background-color: #000000 !important;
  }

  #menu_list, #serviceDataView2, .rightTop, .jsplit-c,
#navigation, #freeBytes span, .middleDiv, #jwWicket div,
.midl_footer, .ui-widget-content:hover, 
#navigation .lastTd, #uploadPromptBox div,
.set_option_list, #jwWicket, .b-m-mpanel,
.ui-state-highlight, #linksShareTab,
#shareBox .shareTabBar, #progressDiv div,
.sign-box, .header, .main, .reviews-media, .create-mc,
.carousel, #uploadPromptBox
  {
    background-color: #222222 !important;
  }

  #serviceDataView2 .cloud, #menu_list .init_option:hover,
.nav_upload_forbid, #taskUploadURL,
th, .set_option_list div:hover, .btn,
.b-m-mpanel div:hover, #shareBox .shareTabSelected,
#onlineFileCipherTasks
  {
    background-color: #1294CC !important;
  }

  #transfer_backup_sync_task, #filterMasking, .ui-selectable,
.ui-jqgrid-bdiv, #shareBox .shareArea,
.file_running_list table td, th
  {
    background-color: #333333 !important;
  }

  #serviceDataView2 .cloud, .nav_upload_forbid, .btn,
#onlineFileCipherTasks
  {
    border-color: #1294CC !important;
  }

  #navigation
  {
    border-color: #222222 !important;
  }

  #uploadPromptBox, #jwWicket, #shareBox,
#progressDiv
  {
    border-color: #1294CC !important;
  }

  #taskUploadURL, input, textarea, .set_option_list,
#shareBox .shareArea,
#detailedDiv .task_status
  {
    border: 1px #1294CC solid !important;
  }

  .ui-jqgrid tr.jqgrow td,
.set_option_setting, .set_option_limits,
.b-m-item, .b-m-idisable,
#offlineContent > div
  {
    border-bottom: 1px #1294CC solid !important;
  }

  #freeBytes, #transfer_backup_sync_task
  {
    border: 1px #222222 solid !important;
  }

  .prompt_tab_option_sel
  {
    color: #1294CC !important;
  }

  #serviceDataView2 .cloud, #menu_list,
#navigation, #navigation .list_path,
.nav_upload_forbid, #freeBytes span,
#taskUploadURL, .offlineTaskC > div,
input, p, .ellipsis, th div, .midl_footer, 
.filename, .filesize, .modified, textarea,
.ui-widget-content, #navigation table a,
.subShareName, #userInfoDiv, .set_option_div,
.prompt_tab_option, .box_content, .b-m-mpanel div:hover,
#transfer_source, #transfer_destination,
.b-m-item, .b-m-idisable, .b-m-mpanel, .bar_name,
#shareBox .shareTabBar, .shareTabUnselected,
.progressBar a span, #controlDiv, .in_progress,
.destination_filepath, .file_processed,
.source_filepath div, .data_progress,
.trans_start_time, .trans_elapsed_time,
#onlineFileCipherTasks
  {
    color: #FFFFFF !important;
  }
}
